import './App.css';
import { BrowserRouter, Route, Router } from "react-router-dom"
import Home from './pages/Home/Home';
function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Router>
          <Route path='/' element={<Home/>}/>

        </Router>
      </BrowserRouter>
    </div>
  );
}

export default App;
